export default function Room() {
    
  const [rooms, setRooms] = useState('')
  const id = useParams()

  async function getFromServer() {
    const response = await fetch(`/api/room/${id}`)
    const data = await response.json()
    console.log(data)
    setRooms(data)
  }

  useEffect(() => {
    getFromServer()
  }, [])

  return (
    <div>Room</div>
  )
}
